import { gql } from 'apollo-boost'

export const ALL_NEWS = gql `query { 
        entries 
        { 
          link 
          description 
          user 
          votes 
          created 
          id 
        } 
      }`

 export const SEARCH_NEWS = gql `query seach($pattern: String!)) { 
        search( 
          pattern: $pattern
        ) 
        { 
          link 
          description 
          user 
          votes 
          created 
          id 
        } 
      }`
